  public partial class SakilaLiteContext : MyTestContext
  {
    public DbSet<Actor> Actor { get; set; }
    public DbSet<Film> Film { get; set; }
    public DbSet<Customer> Customer { get; set; }
    public DbSet<SakilaAddress> Address { get; set; }

    public SakilaLiteContext()
      : base() { }

    public SakilaLiteContext(DbContextOptions options)
      : base(options) { }

    public void OnModelCreating20(ModelBuilder modelBuilder)
    {
      // Self-contained type configuration for code first
      modelBuilder.ApplyConfiguration<Customer>(new CustomerConfiguration());
    }

    protected override void OnModelCreating(ModelBuilder modelBuilder)
    {
      base.OnModelCreating(modelBuilder);

      SetActorEntity(modelBuilder);

      SetFilmEntity(modelBuilder);

      SetFilmActorEntity(modelBuilder);

      SetAddressEntity(modelBuilder);
      
      SetCustomerEntity(modelBuilder);

      OnModelCreating20(modelBuilder);
    }

    public virtual void PopulateData()
    {
      // Actor data
      this.Database.ExecuteSqlRaw(SakilaLiteData.ActorData);
      // Film data
      this.Database.ExecuteSqlRaw(SakilaLiteData.FilmData);
      // FilmActor data
      this.Database.ExecuteSqlRaw(SakilaLiteData.FilmActorData);
      // Address data
      this.Database.ExecuteSqlRaw(SakilaLiteData.AddressData);
      // Customer data
      this.Database.ExecuteSqlRaw(SakilaLiteData.CustomerData);
    }

    public virtual void InitContext(bool populateData = true)
    {
      Database.EnsureDeleted();
      Database.EnsureCreated();
      if (populateData)
        PopulateData();
    }

    public void DropContext()
    {
      Database.EnsureDeleted();
    }

    protected virtual void SetActorEntity(ModelBuilder modelBuilder)
    {
      modelBuilder.Entity<Actor>(entity =>
      {
        entity.ToTable("actor");

        entity.HasIndex(e => e.LastName)
            .HasName("idx_actor_last_name");

        entity.Property(e => e.ActorId)
            .HasColumnName("actor_id")
            .HasColumnType("smallint(5) unsigned");

        entity.Property(e => e.FirstName)
            .IsRequired()
            .HasColumnName("first_name")
            .HasColumnType("varchar(45)")
            .HasMaxLength(45);

        entity.Property(e => e.LastName)
            .IsRequired()
            .HasColumnName("last_name")
            .HasColumnType("varchar(45)")
            .HasMaxLength(45);

        entity.Property(e => e.LastUpdate)
            .HasColumnName("last_update")
            .HasColumnType("timestamp")
            .HasDefaultValueSql("CURRENT_TIMESTAMP");
      });
    }

