      entity.ToTable("address");

      entity.HasIndex(e => e.CityId)
          .HasName("idx_fk_city_id");

      entity.Property(e => e.AddressId)
          .HasColumnName("address_id")
          .HasColumnType("smallint(5) unsigned");

      entity.Property(e => e.Address)
          .IsRequired()
